<script>
import { mapGetters } from 'vuex'
import { warnMessageBox } from '@UTIL'
export default {
    name: 'Redirect',
    created() {
        const res = document.cookie
        const multiple = res.split(';')
        for (let i = 0; i < multiple.length; i++) {
            const key = multiple[i].split('=')
            document.cookie = key[0] + ' =; expires = Thu, 01 Jan 1970 00:00:00 UTC'
        }
    },
    mounted() {
        this.$msg(warnMessageBox({
            message: this.$t('popup_090'),
            type: 'warning',
            content: ''
        }))
    },
    computed: {
        ...mapGetters([
            'isShowDemo',
            'lang'
        ]),
        url() {
            return this.isShowDemo ? 'http://gameclient.g2e.com' : 'https://gw.shicai-intl.com'
        },
        urlText() {
            return this.isShowDemo ? 'gameclient.g2e.com' : 'gw.shicai-intl.com'
        },
        cnTitle() {
            return this.lang === 'cn'
        }
    }
}
</script>
